CREATE TABLE IF NOT EXISTS istat_regioni(codice int not null primary key, nome tinytext);
CREATE TABLE IF NOT EXISTS istat_province(codice int not null primary key, codice_regione int, nome tinytext, sigla tinytext );
CREATE TABLE IF NOT EXISTS istat_comuni(codice int not null primary key, codice_regione int, codice_provincia int, nome tinytext);

TRUNCATE istat_regioni;
TRUNCATE istat_province;
TRUNCATE istat_comuni;




